import "./C3.css";
import C3 from "./C3";
function Card3() {
  return (
    <div className="Card3">
      <C3
        image="https://images.unsplash.com/photo-1517245386807-bb43f82c33c4?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8OHx8YXR0cmFjdCUyMHNpdGUlMjB2aXNpdG9yc3xlbnwwfHwwfHx8MA%3D%3D&auto=format&fit=crop&w=500&q=60"
        heading="Attract Site Visitors"
        text="Experience the pulse of the digital age with our modern trending website, delivering the latest trends and cutting-edge content at your fingertips."
      />
      <C3
        image="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ9tTZnILP4TFf-8aIIgXtCdqBOWMY1Tdb4YQ&usqp=CAU"
        heading="Get More Site Traffic"
        text="Unlock a world of visual innovation and captivate your audience with our creative latest graphics that push the boundaries of imagination."
      />
      <C3
        image="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ59qVJ6sRTx2Toj0YckY67JQ7b55kRsEF6pg&usqp=CAU"
        heading="Engage & Convert"
        text="Modern Trending Websit   Creative Latest Graphics
    Fresh Multimedia Elements
    Engaging Content Copy"
      />
    </div>
  );
}
export default Card3;
